INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (100, 3001, 130011, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", -416.5, 1, 0.0, 2.1, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 2, "ヤマト");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (101, 3001, 130011, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", -416.5, 4, 0.0, 5.68, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 2, "ヤマト");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (102, 3001, 130011, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", -416.5, 1, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "ヤマト");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (100, 3002, 130211, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", -416.5, 1, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (101, 3002, 130211, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", -416.5, 1, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (102, 3002, 130211, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", -416.5, 5, 0.0, 8.53, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 2, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (103, 3002, 130211, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", -416.5, 7, 0.0, 5.67, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (104, 3002, 130211, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", -416.5, 1, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (300, 3004, 130211, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", -416.5, 3, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 3, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (301, 3005, 130211, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", -416.5, 7, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 7, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (200, 3003, 130211, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", -416.5, 2, 0.0, 4.4, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 1, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (201, 3003, 130211, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", -416.5, 7, 0.0, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 7, "フブキ");
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (202, 3003, 130211, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", -416.5, 1, 0.0, 5.6, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 2, "フブキ");
